import React from "react"
import ReactDOM from "react-dom"

const Header = (props) => {
  return (
    <div>
      <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return (
    <div>
      <p>{props.part} {props.exercises}</p>
    </div>
  )
}

const Content = (props) => {
  return (
    <div>
      <p>{props.partInfo.p1[0]} {props.partInfo.p1[1]}</p>
      <p>{props.partInfo.p2[0]} {props.partInfo.p2[1]}</p>
      <p>{props.partInfo.p3[0]} {props.partInfo.p3[1]}</p>
    </div>
  )
}

const Total = (props) => {
  return (
    <div>
      <p>Number of exercises {props.partInfo.p1[1] + props.partInfo.p2[1] + props.partInfo.p3[1]}</p>
    </div>
  )
}

const App = () => {
  const course = "Half Stack application development"

  const partInfo = {
    "p1": ["Funcamentals of React", 10],
    "p2": ["Using props to pass data", 7],
    "p3": ["State of a component", 14]
  }

  return (
    <div>
      <Header course={course}/>
      <Content partInfo={partInfo}/>
      <Total partInfo={partInfo}/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById("root"))
